// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;


contract Medicinee {
    struct MedicineRecord {
        string name;
        uint256 dose;
        uint256 numTimes;
    }

    mapping(uint256 => MedicineRecord) public medicines;
    uint256 public medicineCount;

    event MedicineAdded(uint256 indexed id, string name, uint256 dose, uint256 numTimes);

    function addMedicine(uint256 _id, string memory _name, uint256 _dose, uint256 _numTimes) public {
        medicineCount++;
        medicines[_id] = MedicineRecord(_name, _dose, _numTimes);
        emit MedicineAdded(_id, _name, _dose, _numTimes);
    }

    function getMedicine(uint256 _id) public view returns (string memory, uint256, uint256) {
        MedicineRecord memory medicine = medicines[_id];
        return (medicine.name, medicine.dose, medicine.numTimes);
    }
}
